(1, 'glowna', '<section class=\"container content-section\">\r\n    <h2 class=\"section-header\">Polecane Produkty</h1>\r\n    <p class=\"section-header-comment\">Odwiedź nasz sklep, aby zapoznać się z naszymi produktami</p>\r\n    <div class=\"featured-items\">\r\n        <div class=\"featured-item\">\r\n            <span class=\"featured-item-title\">Rajska wyspa</span>\r\n            <img class=\"featured-item-image\" src=\"Images/Rajska wyspa.jpg\" width=\"150\" height=\"150\">\r\n            <div class=\"featued-item-details\">\r\n                <span class=\"featured-item-price\">10zł/50g</span>\r\n            </div>\r\n        </div>\r\n        <div class=\"featured-item\">\r\n            <span class=\"featured-item-title\">Brokułowe love</span>\r\n            <img class=\"featured-item-image\" src=\"Images/Brokułowe love.jpg\" width=\"150\" height=\"150\">\r\n            <div class=\"featued-item-details\">\r\n                <span class=\"featured-item-price\">35zł/50g</span>\r\n            </div>\r\n        </div>\r\n        <div class=\"featured-item\">\r\n            <span class=\"featured-item-title\">Piernikowy ludzik</span>\r\n            <img class=\"featured-item-image\" src=\"Images/Piernikowy ludzik.jpg\" width=\"150\" height=\"150\">\r\n            <div class=\"featued-item-details\">\r\n                <span class=\"featured-item-price\">15zł/50g</span>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"featured-items\">\r\n        <div class=\"featured-item\">\r\n            <span class=\"featured-item-title\">Wieczorna pokusa</span>\r\n            <img class=\"featured-item-image\" src=\"Images/Wieczorna pokusa.jpg\" width=\"150\" height=\"150\">\r\n            <div class=\"featued-item-details\">\r\n                <span class=\"featured-item-price\">13zł/50g</span>\r\n            </div>\r\n        </div>\r\n        <div class=\"featured-item\">\r\n            <span class=\"featured-item-title\">Ogród rozkoszy</span>\r\n            <img class=\"featured-item-image\" src=\"Images/Ogród rozkoszy.jpg\" width=\"150\" height=\"150\">\r\n            <div class=\"featued-item-details\">\r\n                <span class=\"featured-item-price\">13zł/50g</span>\r\n            </div>\r\n        </div>\r\n        <div class=\"featured-item\">\r\n            <span class=\"featured-item-title\">Dary lata</span>\r\n            <img class=\"featured-item-image\" src=\"Images/Dary lata.jpg\" width=\"150\" height=\"150\">\r\n            <div class=\"featued-item-details\">\r\n                <span class=\"featured-item-price\">15zł/50g</span>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <br>\r\n    <hr>\r\n    <div class=\"newsletter\">\r\n        <h2 class=\"newsletter-header\">Zapisz się do newslettera</h2>\r\n        <p class=\"newsletter-text\">Zapisz się do newslettera i zdobądź aż <b>10%</b> rabatu</p>\r\n        <form class=\"newsletter-form\" autocomplete=\"on\" action=\"./php/contact.php\" method=\"POST\">\r\n            <label for=\"fname\"></label><br>\r\n            <input type=\"text\" id=\"subject\" name=\"subject\" value=\"Twoje imię\" onfocus=\"if (this.value==\'Twoje imię\') this.value=\'\';\">\r\n            <label for=\"email\"></label><br>\r\n            <input type=\"text\" id=\"message\" name=\"message\" value=\"Twój adres email\" onfocus=\"if (this.value==\'Twój adres email\') this.value=\'\';\"><br><br>\r\n            <input class=\"btn btn-primary\" type=\"submit\" value=\"Zapisz się\" name=\"send\">\r\n          </form> \r\n    </div>\r\n</section>', 1),
(2, 'oNas', '<section class=\"container content-section\">\r\n    <h2 class=\"section-header\">Trochę informacji o nas:</h2>\r\n    <br>\r\n    <p class=\"section-desc-comment\">\r\n        Czym jest <b>Świat Herbat?</b> <br> To niezależna firma, która specjalizuje się w wyrobie i sprzedaży różnych herbat na terenie całej Europy. <br>\r\n        Pomysł na naszą działalność pojawił się z pasji i zamiłowania do herbat. Przez 8 lat funkcjonowania na rynku zdążyliśmy <br>\r\n        wyrobić sobie dobrą opinię handlując zarówno z klientami detalicznymi jak i hurtowymi. Przez ten cały okres dostarczaliśmy <br>\r\n        naszym klientom herbaty najwyższej jakości, walcząc o jak najlepsze miejsce na rynku. \r\n    </p>\r\n    <br>\r\n    <img class=\"section-desc-img\" src=\"Images/zespol.jpg\"> <br>\r\n    <p class=\"section-desc-comment\">\r\n        Co w takim razie znajdziecie w naszym sklepie? <br>\r\n        Wyjątkowo aromatyczne i wysokogatunkowe herbaty. W naszej ofercie znajdują się herbaty: <br>\r\n        - Owocowe (dla tych, którzy lubią trochę słodyczy) <br>\r\n        - Czarne (dla miłośników klasyki) <br>\r\n        - Niebieskie <br>\r\n        - Czerwone <br>\r\n        - Zielone <br>\r\n        - Oolong <br>\r\n        - Białe <br>\r\n        - Żółte\r\n    </p>\r\n    <br>\r\n    <p class=\"section-desc-comment\">\r\n        Największy popyt w naszym sklepie jest na herbaty zielone i czarne, dlatego tych w ofercie mamy najwięcej. <br>\r\n        W naszym stacjonarnym sklepie można również zakupić różne akcesoria takie jak: <br> filtry, czajniczki, zaparzacze, \r\n        puszki, porcelanowe kubki i filiżanki oraz kandyzowany gruby cukier. <br> \r\n        Dla wielbicieli Yerby są również specjalne naczynka.\r\n    </p>\r\n    <br>\r\n    <p class=\"section-desc-scomment\">\r\n        Zamów nasz produkt i spróbuj, a nie pożałujesz!\r\n    </p>\r\n    <br>\r\n</section>', 1),
(3, 'sklep', '<link rel=\"stylesheet\" type=\"text/css\" href=\"css/shop.css\">\r\n\r\n<section class=\"container content-section\">\r\n	<table>\r\n		<h2 class=\"section-header\">Sklep</h2>\r\n		<tr>\r\n			<th>Numer</th>\r\n			<th>Zdjęcie</th>\r\n			<th>Nazwa</th>\r\n			<th>Opis</th>\r\n			<th>Cena</th>\r\n			<th>Waga</th>\r\n			<th>Koszyk</th>\r\n		</tr>\r\n\r\n		<tr>\r\n			<td>1.</td>\r\n			<td><img src=\"Images/CzerwonySmok.jpg\" alt=\"zdj\" width=\"100px\" height=\"50px\"></td>\r\n			<td>Norbert</td>\r\n			<td>Młody Żółwik, ma zaledwie 1 roczek. Szybko odnajduje się w otoczeniu i jest bardzo przyjazny. Nie je dużo ale z rozwojem wieku zapotrzebowanie będzie rosło</td>\r\n			<td>8.99zł</td>\r\n			<td>50g</td>\r\n			<td><button role=\"button\">Zakup</button></td>\r\n\r\n		</tr>\r\n		<tr>\r\n			<td>2.</td>\r\n			<td><img src=\"Images/DotykAniola.jpg\" alt=\"zdj\" width=\"100px\" height=\"50px\"></td>\r\n			<td>Adrianek</td>\r\n			<td>Żółw ma 3 lata. Łatwo wpasowuje się w towarzystwo lecz pod względem wyżywienia jest mocno wybredny. Je same najdroższe karmy. Oczywiście na miejscu bądź przy kontakcie telefonicznym poinformujemy o jego gustach!</td>\r\n			<td>8.99zł</td>\r\n			<td>50g</td>\r\n			<td><button role=\"button\">Zakup</button></td>\r\n\r\n		</tr>\r\n		<tr>\r\n			<td>3.</td>\r\n			<td><img src=\"Images/EarlGrey.jpg\" alt=\"zdj\" width=\"100px\" height=\"50px\"></td>\r\n			<td>Martynka</td>\r\n			<td>Żółw 4 letni. Jest typem zazdrośnika o inne zwierzęta w domu więc zalecane jest posiadanie tylko tego żółwika. Z wyżywieniem nie ma problemu, gdyż każda karma mu pasuje a nawet frytki. </td>\r\n			<td>8.99zł</td>\r\n			<td>50g</td>\r\n			<td><button role=\"button\">Zakup</button></td>\r\n\r\n		</tr>\r\n		<tr>\r\n			<td>4.</td>\r\n			<td><img src=\"Images/JaponskaWisnia.jpg\" alt=\"zdj\" width=\"100px\" height=\"50px\"></td>\r\n			<td>Szymon</td>\r\n			<td>Żółw 2 letni. Jest typem nieśmiałego żółwika i chwilę zajmuje zanim się zadomowi w nowym otoczeniu. Mimo wszystko jak już się zadomowi jest wspaniałym kompanem w życiu codziennym. Bardzo się przywiązuje do właściciela i tęski jak go nawet na chwilę brakuje</td>\r\n			<td>8.99zł</td>\r\n			<td>50g</td>\r\n			<td><button role=\"button\">Zakup</button></td>\r\n\r\n		</tr>\r\n		<tr>\r\n			<td>5.</td>\r\n			<td><img src=\"Images/KalipsoPremium.jpg\" alt=\"zdj\" width=\"100px\" height=\"50px\"></td>\r\n			<td>Kacperek</td>\r\n			<td>Żółw 7 letni. Jak na 7 lat życia jeden z naszych mniejszych żółwików. Szybko się zadomawia w nowym domu i nie jest wybredny. Cudowny kompan, nawet na długie wyjazdy.</td>\r\n			<td>8.99zł</td>\r\n			<td>50g</td>\r\n			<td><button role=\"button\">Zakup</button></td>\r\n		</tr>\r\n	</table>\r\n</section>', 1),
(4, 'prezenty', '<section class=\"container content-section\">\r\n	<br><br><br><br><br><br><br><br><br>\r\n	<h3 class=\"section-b2b-menu-header2\">\r\n		Prezenty!\r\n		</h3>\r\n		<br>\r\n		<p class=\"section-b2b-menu-comment\">\r\n			Już wkrótce będziemy w ofercie mieli dla was prezenty! <br/><br/>\r\n			Myślałeś, żeby kupić komuś bliskiemu tani, ale pyszny prezent?. <br/>\r\n			To idealna okazja, mamy różne smaki i różne ceny, więc <br/>\r\n			możemy się dostosować do wszelkiego rodzaju klientów. <br/><br/>\r\n			Prezenty będziemy wysyłać opakowane w wybrany przez Ciebie. <br>\r\n			rodzaj opakowania z możliwością schowania kartki z życzeniami! <br>\r\n			<img class=\"featured-item-image2\" src=\"Images/gift.jpg\" width=\"150\" height=\"150\">\r\n		</p>\r\n</section>\r\n', 1),
