(7, 'filmy', '<link rel=\"stylesheet\" type=\"text/css\" href=\"css/videos.css\">\r\n\r\n<section class=\"container content-section\">\r\n    <h3 class=\"section-b2b-menu-header\">\r\n        <br><br><br><br>\r\n        Nasze produkcje!\r\n        </h3>\r\n        <br>\r\n            <div id=\"movies\">\r\n                <br>\r\n                <div class=\"movie-item\">\r\n                    <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/5oSbjjsMx68?autoplay=1\" title=\"YT player\" frameborder=\"0\" allow=\"autoplay;\" allowfullscreen></iframe>\r\n                    <p class=\"movie-item-title\"><b>Tytuł: </b>Jaką herbatę wybrać?<br><br><b>Opis: </b><br> Chcesz rozpocząć swoją przygodę z herbatą, <br> ale nie wiesz co wybrać?\r\n                        <br> W tym filmie przedstawimy Ci rodzaje herbat <br>i ich najlepsze cechy. <br><br> Pomożemy Ci dobrać coś w Twoim stylu!</p>\r\n                </div>\r\n                <br /><br />\r\n                <div class=\"movie-item\">\r\n                    <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/xvz8XtWBbXQ?\" title=\"YT player\" frameborder=\"0\" allow=\"autoplay\" allowfullscreen></iframe>\r\n                    <p class=\"movie-item-title\"><b>Tytuł: </b>W czym parzyć herbatę?<br><br><b>Opis: </b><br> Nie wiesz w czym najlepiej parzyć herbatę?\r\n                        <br> Odpowiedź jest prosta. Obejrzyj nasz film, a się dowiesz <br> Pokażemy różne rodzaje naczyń i technik\r\n                        <br><br> Patrzenie jak parzy się herbata długo nie trwa, ale jest lepsze niż telewizja</p>\r\n                </div>\r\n                <br /><br />\r\n                <div class=\"movie-item\">\r\n                    <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/vC5jc4JCRk0?\" title=\"YT player\" frameborder=\"0\" allow=\"autoplay\" allowfullscreen></iframe>\r\n                    <p class=\"movie-item-title\"><b>Tytuł: </b>Jak pra