INSERT INTO `products` (`id`, `title`, `description`, `creation_date`, `modify_date`, `expiration_date`, `netto_value`, `vat`, `amount`, `availability_status`, `category`, `weight`, `image`) VALUES
(15, 'Brokułowe love', 'Zielony oolong o warzywno karmelowym smaku, który ucieszy podniebienia roślinnych smakoszy.\r\n', '2023-01-25', '2023-01-25', '2024-01-25', 35, '23', 5, 1, 'Oolong', 50, ),
(16, 'Cieniste zarośla', 'podrapane kolana, rozczochrane włosy i błogi uśmiech…smak dziecięcej zabawy zawarty w aromatycznej kompozycji czarnej herbaty z dodatkiem trawy cytrynowej i płatków róży.', '2023-01-25', '2023-01-25', '2024-01-25', 13, '23', 25, 1, 'Czarna', 50, ),
(17, 'Dary lata', 'Słodycz malin, wiśniowa kwasota i różany aromat. Wybuchowa mieszanka przenosząca w ostatnie dni upalnego lata.', '2023-01-25', '2023-01-25', '2024-01-25', 15, '23', 30, 1, 'Czarna', 50, ),
(18, 'Jaśminowy zakątek', 'W małej, chińskiej wiosce pośród wzgórz rozkwitają skąpane słońcem krzewy jaśminu. Ich delikatna woń spowija wszystko wokół i sprawia, że czas płynie wolniej. Skosztuj chwili relaksu dzięki aromatycznemu naparowi z kwiatów jaśminu.', '2023-01-25', '2023-01-25', '2024-01-25', 19, '23', 8, 1, 'Zioła', 50, ),
(19, 'Ogród rozkoszy', 'Pachnące i soczyste owoce, kosz piknikowy i miękki koc w słonecznym sadzie. To skojarzenia, które chcieliśmy przywołać tworząc tę aromatyczną mieszankę zielonej herbaty z dodatkiem wiśni, kwiatów piwonii i płatków róży.\r\n', '2023-01-25', '2023-01-24', '2024-01-25', 13, '23', 25, 1, 'Zielona', 50, );
INSERT INTO `products` (`id`, `title`, `description`, `creation_date`, `modify_date`, `expiration_date`, `netto_value`, `vat`, `amount`, `availability_status`, `category`, `weight`, `image`) VALUES
(20, 'Piernikowy ludzik', 'Aromat cynamonu, świąteczne piosenki i on - mały piernikowy ludzik. Zanurz się w korzennym aromacie i pomóż mu odnaleźć jego lukrowane guziczki.\r\n', '2023-01-25', '2023-01-25', '2024-01-25', 15, '23', 30, 1, 'Czarna', 50, ),
(21, 'Pustynna burza', 'Czerwone piaski pustyni, soczyste owoce, bujna roślinność pobliskiej oazy i nuta burzowej ostrości. Wyjątkowe połączenie liści afrykańskiego czerwonokrzewu z kawałkami żurawiny i słodkiej miodowej nuty.\r\n', '2023-01-25', '2023-01-25', '2024-01-25', 14, '23', 8, 1, 'Rooibos', 50, ),
(22, 'Rajska wyspa', 'Soczyste pomarańcze, ciepły piasek, zachód słońca i letni wiatr. Ta wyjątkowa mieszanka owoców i herbaty wydobywa smak egzotycznych wakacji', '2023-01-25', '2023-01-25', '2024-01-25', 10, '23', 12, 1, 'Owocowa', 50, ),
(23, 'Wiosenne igraszki', 'Leśna polana, miękki mech pod stopami i zapach aromatycznych ziół w koszyku. Mieszanka ziołowo-owocowa na lepszy sen i ukojenie nerwów.\r\n', '2023-01-25', '2023-01-25', '2024-01-25', 12, '23', 12, 1, 'Zioła', 50, ),
(24, 'Wieczorna pokusa', 'Ta ziołowa mieszanka na bazie melisy otula niczym puchaty szlafrok w chłodny, jesienny wieczór, przynosi ukojenie skołatanym nerwom i pomaga zasnąć bez liczenia owiec.\r\n', '2023-01-25', '2023-01-25', '2024-01-25', 13, '23', 15, 1, 'Zioła', 50, );

